import React from 'react'

function About () {
    return (
        <div className="container">
            <div class= "text-white text-center" id="about"> 
                <h2>About us</h2>
            </div>
            <div class="row my-2">
                <p>Como decoradores de porcelana, cerámica y vidrio, sabemos la importancia que tiene para nuestros clientes un marcaje de calidad y duradero. En nuestro amplio catálogo de tazas mug, tazas de café, servicios de mesa y copas y jarras 
                   de vidrio podrás elegir entre multitud de piezas para personalizar. Una vez hayas elegido la pieza que más se adapte a tu colección/campaña de marketing, nos encargaremos de personalizarla y de entregarla en el packaging que necesites.
                   Para saber más sobre nuestros servicios consulta los diferentes apartados en esta sección.</p>
            </div>
        </div>
    )
}

export default About;
